import React, { Fragment } from 'react';
import './App.css';

function App() {
  return (
    <Fragment>
      <div className='heading'>
        <div className='hexagon1'>
          <img src='https://i.imgur.com/TTkYZLQ.jpg' />
        </div>
        <div className='hexagon2'>
          <img src='https://i.imgur.com/HCaTey5.png' />
        </div>
      </div>
    </Fragment>
  );
}

export default App;
